    slat = "".join(random.choices("0123456789ABCDEFGHIJKLMNOPQRSTVUWXYZzbcdefghijklmnopqrstuvwxyz", k=32))
    key = ""
    v2 = SHA512.new(bytes.fromhex(SHA512.new(slat.encode()).hexdigest() + "1b1889c77f51263cf6dcef9f7e94233f1c91ff9af7b8f2786aef68ba8c21b9bfb16c00dcca9116b5f9833a3e2a1b6ffad7b8b19843e8f96e9ec22a3d26b0aa5a")).digest()
    v2 = bytes.hex(v2)
    # print(v2)
    crypto = AES.new(key=bytes.fromhex(v2[:64]), mode=AES.MODE_GCM, nonce=bytes.fromhex(v2[64:88]))
    ciphertext, mac = crypto.encrypt_and_digest(v1)
    return base64.b64encode(bytes([116, 99, 6, 16, 0, 0]) + slat.encode() + ciphertext + mac).decode()

